
DROP TABLE IF EXISTS StopDetails;
DROP TABLE IF EXISTS LineColors;
DROP TABLE IF EXISTS Stops;
DROP TABLE IF EXISTS Riderships;
DROP TABLE IF EXISTS Stations;

CREATE TABLE LineColors (
   LineID  TINYINT AUTO_INCREMENT PRIMARY KEY,
   Color   NVARCHAR(16) NOT NULL UNIQUE
                        CHECK (Color IN ('Red', 'Blue', 'Green', 'Brown', 'Purple', 'Purple-Express', 'Yellow', 'Pink', 'Orange'))
);

CREATE TABLE Stations (
   StationID  INT PRIMARY KEY,
   Name       NVARCHAR(256) NOT NULL
);

CREATE TABLE Stops (
   StopID     INT PRIMARY KEY,
   StationID  INT NOT NULL,
   Name       NVARCHAR(256) NOT NULL,
   Direction  NVARCHAR(1) NOT NULL CHECK (Direction IN ('N', 'E', 'W', 'S')),
   ADA        BIT NOT NULL DEFAULT 0,
   Latitude   FLOAT NOT NULL,
   Longitude  FLOAT NOT NULL,
   FOREIGN KEY (StationID) REFERENCES Stations(StationID) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE StopDetails (
   StopID  INT NOT NULL,
   LineID  TINYINT NOT NULL,
   PRIMARY KEY (StopID, LineID),
   FOREIGN KEY (StopID) REFERENCES Stops(StopID) ON UPDATE CASCADE ON DELETE CASCADE,
   FOREIGN KEY (LineID) REFERENCES LineColors(LineID) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE Riderships (
   StationID   INT NOT NULL,
   TheDate     DATE NOT NULL,
   TypeOfDay   NVARCHAR(1) NOT NULL,
   DailyTotal  INT NOT NULL,
   PRIMARY KEY (StationID, TheDate),
   FOREIGN KEY (StationID) REFERENCES Stations(StationID) ON UPDATE CASCADE ON DELETE CASCADE
);












